2:"66";}s:8:"question";a:7:{s:5:"title";s:12:"Вопрос";s:4:"name";s:8:"Юлия";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:1175:"Добрый день, мне 23 года, в апреле 2024 года у меня обнаружили ВПЧ 16 и 18 типов, и еще несколько типов, которые, как мне объяснили, менее опасны. Тогда назначили изопризониз, сейчас в сентябре 2024 снова сдавала анализ на ВПЧ 16 и 18, обнаружен, еще я вспомнила, что не правильно тогда запомнила схему лечения и не полный курс таблеток прошла. Сейчас гинеколог назначила мне уколы Аллокин-альфа (6 уколов через день), что бы усыпить вирус. Я много изучила про ВПЧ и почти везде пишут, что вирус уходит сам, что лечения от него нет.
